(function (win, $) {
    if (!$ || (typeof $ != 'function')) {
        throw new Error('Browsertips\'s JavaScript requires jQuery');
    }
    // xp系统检测
    var lessThanXP = (function () {
        // Windows NT 后的任意 尽可能少 且后面是;
        var matchResult = navigator.userAgent.match(/Windows NT (.+?)(?=;)/);

        // 非windows
        if (!matchResult) return false;

        // NT6.1 以下 win7、winServer2008R2 以下
        return win.parseFloat(matchResult[1], 10) < 6.1;
    })();

    // 浏览器版本判断
    var Browser = {
        isIE67: '\v' == 'v',
        isIE8: !!document.all && document.querySelector && !document.addEventListener,
        isIE9: !!document.all && document.addEventListener && !window.atob,
        isIE10: !!document.all && window.atob,
        isIE11: '-ms-scroll-limit' in document.documentElement.style && '-ms-ime-align' in document.documentElement.style,
        // IE6~11
        isIE: ((!!document.all && document.compatMode) || ('-ms-scroll-limit' in document.documentElement.style && '-ms-ime-align' in document.documentElement.style)),
        isWebkit: 'WebkitAppearance' in document.documentElement.style,
        isFirefox: !!navigator.userAgent.match(/firefox/i)
    };
    // 默认配置
    var DEFAULT_CFG = {
        ieUrl: 'https://support.microsoft.com/zh-cn/help/17621/internet-explorer-downloads',
        chromeUrl: 'http://www.google.cn/intl/zh-CN/chrome/browser/desktop/',
        zIndex: 5000,
        timeout: 60000,
        useIE: true,
        useChrome: true
    };
    // 针对XP和IE8提醒的通用结构和样式
    function preCommon() {
        var $wrap = $('<div class="browser-check-shade"></div>'),
            $box = $('<div class="browser-check-box"></div>'),
            $close = $('<span class="browser-check-close"></span>'),

            commonStyle = '.browser-check-shade{position:absolute;top:0;right:0;bottom:0;left:0;background:url("data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAEAAAABAQMAAAAl21bKAAAAA1BMVEUAAACnej3aAAAAAXRSTlOArV5bRgAAAApJREFUeF5jYAAAAAIAAd6ej78AAAAASUVORK5CYII=");background:rgba(0,0,0,.5);font-size:14px;line-height:26px}.browser-check-box{width:460px;height:260px;position:absolute;top:40%;left:50%;margin-top:-130px;margin-left:-230px;background:#fff;border-radius:4px}.browser-check-close{position:absolute;top:10px;right:10px;width:22px;height:22px;cursor:pointer;background:url("data:image/png;base64,") center no-repeat}.browser-check-key{color:#f6860e}.browser-check-info{padding: 50px 30px 0 30px}.browser-check-suggestion{text-align:center}';

        return {
            $wrap: $wrap,
            style: commonStyle,
            $el: $box.append($close).appendTo($wrap)
        };
    }

    // 关闭事件
    function initClose($el, $style) {
        $el.on('click', '.browser-check-close', function () {
            $el.remove();
            $style.remove();
        });
    }

    // xp 提示
    function xp() {
        var com = preCommon(),
            $xpTips = $('<div class="browser-check-less-xp"><div class="browser-check-info"><span class="browser-check-warn-icon"></span><div class="browser-check-warn-info">检测到您目前的操作系统版本是 <span class="browser-check-key">windows XP</span>，由于 <span class="browser-check-key">windows XP</span> 目前微软公司已经不再维护，可能会对目前系统的稳定使用造成影响。</div></div><div class="browser-check-suggestion">建议您升级到 <span class="browser-check-key2">windows 7</span> 及其以上版本的系统</div></div>'),
            xpStyle = '.browser-check-warn-icon{float:left;width:50px;height:78px;background:url("data:image/png;base64,") center no-repeat}.browser-check-warn-info{height:78px;margin-left:70px;padding-left:26px;background:url("data:image/png;base64,") left top repeat-y}.browser-check-less-xp>.browser-check-suggestion{margin-top:50px}.browser-check-key2{color:#3980e2}',

            $style = $('<style>' + com.style + xpStyle + '</style>').appendTo('head');

        com.$el.append($xpTips);
        com.$wrap.appendTo('body');

        initClose(com.$wrap, $style);
    }

    // ie8 提示
    function ie8(cfg) {
        var com = preCommon(),
            $ie8Tips = $('<div class="browser-check-ie8"><div class="browser-check-info">检测到您在使用的浏览器为<span class="browser-check-key">IE8</span>，由于 <span class="browser-check-key">IE8</span>目前微软 公司已经不再维护，可能会对目前系统的稳定使用造成影响，您可以选择：</div><div class="browser-check-suggestion">' + (cfg.useIE ? ('<a class="browser-check-browser-item newie" href="' + cfg.ieUrl + '"target="_blank"><span class="browser-check-browser-icon icon-newie"></span><span class="browser-check-name">IE最新版</span></a>') : '') + (cfg.useChrome ? ('<a class="browser-check-browser-item chrome" href="' + cfg.chromeUrl + '"target="_blank"><span class="browser-check-browser-icon icon-chrome"></span><span class="browser-check-name">Chrome</span></a>') : '') + '</div></div>'),
            ie8Style = '.browser-check-ie8>.browser-check-suggestion{margin-top:10px}.browser-check-browser-item{display:inline-block;margin:0 20px}.browser-check-browser-icon{display:block;width:100px;height:100px}.icon-newie{background:url("data:image/png;base64,") center no-repeat}.icon-chrome{background:url("data:image/png;base64,") center no-repeat}',
            $style = $('<style>' + com.style + ie8Style + '</style>').appendTo('head');

        com.$el.append($ie8Tips);
        com.$wrap.appendTo('body');

        initClose(com.$wrap, $style);
    }

    // ie9 提示
    function ie9(cfg) {
        var $ie9Tips = $('<div></div>', {
            id: 'ie9-tips',
            'style': 'position:fixed;top:0;left:50%;margin-left:-280px;width:560px;height:40px;color:#dd2727;background:#f2dede;text-align:center;border-radius:3px;line-height:40px;font-size:13px;'
        }).html('检测到您的浏览器版本过低，为了更好的使用体验，建议您升级到 <a href="' + cfg.ieUrl + '"target="_blank" style="color:#dd2727;font-weight:bold;">新版本的IE浏览器</a>').append(
            // 插入关闭按钮
            $('<span title= "关闭" style= "position: absolute;top:0;right:10px;font-size:18px;line-height:40px;cursor:pointer" onclick= \'$("#ie9-tips").remove();\'>×</span>')
        ).css('z-index', cfg.zIndex).appendTo('body');

        setTimeout(function () {
            $ie9Tips.remove();
            $ie9Tips = null;
        }, cfg.timeout);
    }

    // dom ready 时才能触发显示
    $(function () {
        var cfg = DEFAULT_CFG;
        if (win.BROWSER_TIPS_CFG) {
            cfg = $.extend({}, cfg, win.BROWSER_TIPS_CFG);
        }
        // xp 
        if (lessThanXP) {
            xp(cfg);
            return;
        }

        if (Browser.isIE8) {
            ie8(cfg);
            return;
        }

        // IE9的升级提醒
        if (Browser.isIE9) {
            ie9(cfg);
            return;
        }
    });

})(this, this.jQuery);